import React, { useState, useEffect } from 'react';
import Grid from '@mui/material/Grid';
import { GiCow } from "react-icons/gi";
import './Home.css';
import PropTypes from 'prop-types';
import Box from '@mui/material/Box';
import Gridbox from './page-com'

const divStyle = {
  color: '#082459',
  fontSize: '24px',
  fontFamily: 'Roboto',
  fontWeight: 700,
  wordWrap: 'break-word'
};

function Item(props) {
  const { sx, ...other } = props;
  return (
    <Box
      sx={{
        bgcolor: (theme) => (theme.palette.mode === 'dark' ? '#101010' : '#fff'),
        color: (theme) => (theme.palette.mode === 'dark' ? 'grey.300' : 'grey.800'),
        border: '1px solid',
        borderColor: (theme) =>
          theme.palette.mode === 'dark' ? 'grey.800' : 'grey.300',
        p: 1,
        borderRadius: 2,
        fontSize: '0.875rem',
        fontWeight: '700',
        ...sx,
      }}
      {...other}
    />
  );
}

Item.propTypes = {
  sx: PropTypes.oneOfType([
    PropTypes.arrayOf(
      PropTypes.oneOfType([PropTypes.func, PropTypes.object, PropTypes.bool]),
    ),
    PropTypes.func,
    PropTypes.object,
  ]),
};

export default function Homefarmer() {

  return (
    <div style={{margin:'16px'}}>
      <div style={divStyle}>ยินดีต้อนรับ</div>
    <div style={{ width: '100%'}}>
      <Box
        sx={{
          display: 'grid',
          gap: 1,
          gridTemplateColumns: 'repeat(2, 1fr)',
        }}
      >
        <Grid item xs>
            <Item style={{ backgroundColor: 'rgb(255, 247, 205)' }}>
              <GiCow size={30} />
              <div style={{ fontSize: '30px', fontWeight: 'bold' }}>10</div> {/* {{users.n}} */}
              <div>Total Cows (ตัว)</div>
            </Item>
        </Grid>
        <Grid item xs>
            <Item style={{ backgroundColor: 'rgb(255, 247, 205)' }}>
              <GiCow size={30} />
              <div style={{ fontSize: '30px', fontWeight: 'bold' }}>10</div> {/* {{users.n}} */}
              <div>Total Cows (ตัว)</div>
            </Item>
        </Grid>
        <Grid item xs>
            <Item style={{ backgroundColor: 'rgb(255, 247, 205)' }}>
              <GiCow size={30} />
              <div style={{ fontSize: '30px', fontWeight: 'bold' }}>10</div> {/* {{users.n}} */}
              <div>Total Cows (ตัว)</div>
            </Item>
        </Grid>
        <Grid item xs>
            <Item style={{ backgroundColor: 'rgb(255, 247, 205)' }}>
              <GiCow size={30} />
              <div style={{ fontSize: '30px', fontWeight: 'bold' }}>10</div> {/* {{users.n}} */}
              <div>Total Cows (ตัว)</div>
            </Item>
        </Grid>
      </Box>
    </div>
    </div>
  );
}
